import React from "react";
import "./Card.css";

const Card = props => (
  <div className="container">
  <div className="card row" onClick={() => props.clickCount(props.id)}>
    <div className="img-container col">
      <img alt={props.name} src={props.image} />
    </div>
  </div>
  </div>
);

export default Card;
